import React from "react";
import { ToastContainer } from "react-toastify";
import "./App.css";
import Navbar from "./components/Navbar";
function App() {
  return (
    <div className="App">
      {/* We need 2 routes 1) /add 2) /edit/:id */}
      <ToastContainer />
      <Navbar />
      <Switch>
        <Route exact path="/">
          <h2>welcome to contact app</h2>
        </Route>
        <Route exact path="/add">
          <h2>I am add component</h2>
        </Route>
        <Route exact path="/edit/:id">
          <h2>I am edit component</h2>
        </Route>
      </Switch>
    </div>
  );
}

export default App;
